(1, 'How it works', '<div class="page-header">\n<h3>How It Works</h3>\n</div>\n\n<style>\n.mybadge{\nbackground-color:#fff;\nborder: 1px solid rgb(29, 153, 216);\nborder-radius:50%;\ntext-align: center;\nmargin-top: 23px;}\n\n.mybadge span{\npadding:5px;\ndisplay:block;\nfont-weight:bold;}\n\n.contentpanel {\nmin-height: 20px;\npadding: 19px;\nmargin-bottom: 20px;\nbackground-color: #fff;\nborder: 1px solid #ccc;\nborder-radius: 0px;}\n</style>\n\n<h3>Find and book PT''s for training when and where you want.</h3>\n<article>	\n	<div class="row">\n		<div class="col-sm-1 col-md-1 col-lg-1" style="max-height: 50px; max-width: 60px;">\n			<h4 class="mybadge"><span>1</span></h4>\n		</div>\n		<div class="col-sm-11 col-md-11 col-lg-11">\n			<div class="contentpanel">\n			<h4>Requesting a trainer</h4>\n			<p>Request a trainer with your training type, time and area preference.</p>\n			<p><strong>You dont need to sign-up first; a new account will be created automatically using your email address.<strong></p> \n			<p>Approved trainers will recieve your request and have the option to provide you with a quote.</p>\n			</div>\n		</div> \n	</div>\n	\n	<div class="row">\n		<div class="col-sm-1 col-md-1 col-lg-1" style="max-height: 50px; max-width: 60px;">\n			<h4 class="mybadge"><span>2</span></h4>\n		</div>		  \n		<div class="col-sm-11 col-md-11 col-lg-11">\n			<div class="contentpanel">\n			<h4>Training quotes</h4>\n			<p>You will recive quotes by email from trainers that want to train you.</p>\n			<p>Trainers will quote you on price and also define the training service that they can provide you. For example, if you request training at Osbrorne Park at midday, a trainer would put in the quote that they would use Herdsman lake.</p>			\n			</div>\n		</div> \n	</div>\n	\n	<div class="row">\n		<div class="col-sm-1 col-md-1 col-lg-1" style="max-height: 50px; max-width: 60px;">\n			<h4 class="mybadge"><span>3</span></h4>\n		</div>		  \n		<div class="col-sm-11 col-md-11 col-lg-11">\n			<div class="contentpanel">\n			<h4>Booking a trainer</h4>\n			<p>You will need to pay a deposit for a quote that you want. You pay online with Paypal through the web site.</p>\n			<p>You must give 24 hours notice to the trainer if you need to reschedule a training session.</p>\n			<p>If you cancel a training sessions you will not get a refund on your deposit.</p>\n			</div>\n		</div> \n	</div>\n	\n	<div class="row">\n		<div class="col-sm-1 col-md-1 col-lg-1" style="max-height: 50px; max-width: 60px;">\n			<h4 class="mybadge"><span>4</span></h4>\n		</div>		  \n		<div class="col-sm-11 col-md-11 col-lg-11">\n			<div class="contentpanel">\n			<h4>Finishing a session</h4>\n			<p>When your training session is complete you will need to complete the online payment and provide feedback on the training.</p>\n			</div>\n		</div> \n	</div>	\n</article>     \n\n', '2015-10-12 10:05:25'),
(2, 'Training Safety', '<div class="page-header">\n<h3>Training Safety</h3>\n</div>\n\n<article>	\n<div class="row">\n	<div class="col-sm-12 col-md-12 col-lg-12">\n		<p>Personal safely while training is a very important to us and all the trainers registered with us.</p>\n		<p>All trainers need to provide personal training certification and proof of insurance before becoming approved to receive requests.</p>\n	</div> \n</div>\n</article>  ', '2015-10-13 01:19:34'),
(3, 'workout_guide', 'coming soon', '2015-10-13 01:40:29'),
(4, 'nutrition_guide', 'coming soon', '2015-10-13 01:40:41'),
(5, 'Terms Of Use', '<div class="page-header">\n<h3>Terms and Conditions ("Terms")</h3>\n</div>\n\n<p>Last updated: October 06, 2015</p>\n\n<p>Please read these Terms and Conditions ("Terms", "Terms and Conditions") carefully before using the https://ptondemand.com.au website (the "Service") operated by PT On Demand ("us", "we", or "our").</p>\n\n<p>Your access to and use of the Service is conditioned on your acceptance of and compliance with these Terms. These Terms apply to all visitors, users and others who access or use the Service.</p>\n\n<p>By accessing or using the Service you agree to be bound by these Terms. If you disagree with any part of the terms then you may not access the Service.</p>\n\n<p><strong>Accounts</strong></p>\n\n<p>When you create an account with us, you must provide us information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the Terms, which may result in immediate termination of your account on our Service.</p>\n\n<p>You are responsible for safeguarding the password that you use to access the Service and for any activities or actions under your password, whether your password is with our Service or a third-party service.</p>\n\n<p>You agree not to disclose your password to any third party. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.</p>    \n\n<p><strong>Links To Other Web Sites</strong></p>\n\n<p>Our Service may contain links to third-party web sites or services that are not owned or controlled by PT On Demand.</p>\n\n<p>PT On Demand has no control over, and assumes no responsibility for, the content, privacy policies, or practices of any third party web sites or services. You further acknowledge and agree that PT On Demand shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with use of or reliance on any such content, goods or services available on or through any such web sites or services.</p>\n\n<p>We strongly advise you to read the terms and conditions and privacy policies of any third-party web sites or services that you visit.</p>\n\n<p><strong>Termination</strong></p>\n\n<p>We may terminate or suspend access to our Service immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach the Terms.</p>\n\n<p>All provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.</p>\n\n<p>We may terminate or suspend your account immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach the Terms.</p>\n\n<p>Upon termination, your right to use the Service will immediately cease. If you wish to terminate your account, you may simply discontinue using the Service.</p>\n\n<p>All provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.</p>\n\n<p><strong>Governing Law</strong></p>\n\n<p>These Terms shall be governed and construed in accordance with the laws of Western Australia, Australia, without regard to its conflict of law provisions.</p>\n\n<p>Our failure to enforce any right or provision of these Terms will not be considered a waiver of those rights. If any provision of these Terms is held to be invalid or unenforceable by a court, the remaining provisions of these Terms will remain in effect. These Terms constitute the entire agreement between us regarding our Service, and supersede and replace any prior agreements we might have between us regarding the Service.</p>\n\n<p><strong>Changes</strong></p>\n\n<p>We reserve the right, at our sole discretion, to modify or replace these Terms at any time. If a revision is material we will try to provide at least 60 days notice prior to any new terms taking effect. What constitutes a material change will be determined at our sole discretion.</p>\n\n<p>By continuing to access or use our Service after those revisions become effective, you agree to be bound by the revised terms. If you do not agree to the new terms, please stop using the Service.</p>\n\n<p>Our Terms and Conditions agreement was created by TermsFeed.</p>\n\n<p><strong>Contact Us</strong></p>\n\n<p>If you have any questions about these Terms, please contact us.</p>', '2015-10-12 18:52:44'),
(6, 'Privacy Policy', '<div class="page-header">\n<h3>Privacy Policy</h3>\n</div>\n\nThis Privacy Policy applies to the services offered by PT on Demand.<br>\n<br>\n1. Personal information:<br>\n<br>\nThe Company is committed to safeguarding personal privacy. It recognises that individuals have a right to control how their personal information is collected and used. Providing personal information is an act of trust and it is taken seriously. Unless given consent to do otherwise, the Company will only collect and use personal information as set out below.<br>\n<br>\n2. Collecting personal information:<br>\n<br>\nThe Company will not collect or monitor any personal information about an individual without their consent. The only personal information collected is what has been provided voluntarily.<br>\n<br>\n3. Use of tracking technologies:<br>\n<br>\nThe Company uses tracking technologies such as cookies or web beacons to make use of the website and services as convenient as possible. Cookies are pieces of information that a web site transfers to a computer''s hard disk for record keeping purposes. Most web browsers are set to accept tracking technologies such as cookies or web beacons. These tracking technologies do not themselves personally identify users, although they do identify a user''s browser. 4. Using and disclosing your personal information:<br>\n<br>\nPersonal Information will be used for the following primary purpose:<br>\n<br>\n<br>\n<br>\n- To fulfill obligations under any sale and purchase contract and/or any other contract between the individual and the Company.<br>\n<br>\n- To render services related to Company''s business such as warranty or after sales services.<br>\n<br>\n<br>\n<br>\nFor the purpose described above, information may be shared with Company''s group companies either in Australia or overseas. Also, in order to operate the web site or deliver a service, personal information may also be shared with a service provider, a non-Company group company.<br>\n<br>\n5. Contact by the Company:<br>\n<br>\nThe Company may contact individuals using the information, which was provided by them in order to:<br>\n<br>\n- Provide information that may be of interest about upgrades, new Company products, special offers and other matters that may be of interest.<br>\n<br>\n- To send newsletters.<br>\n<br>\n6. Individual''s right of access:<br>\n<br>\nIndividuals have the right to review the information that may be recorded on the Company''s database. Information may be reviewed by contacting the Company on the customer enquiry number [Number].<br>\n<br>\n9. The Company and links to other web sites:<br>\n<br>\nThe Company provides links to web sites outside of the Company site. These linked sites are not under the control of Company, and the Company is not responsible for the conduct of companies linked to the Company web site, nor for the performance or otherwise of any content and/or software contained in such external websites.<br>\n<br>\n10. Problems or queries:<br>\n<br>\nQueries relating to the Privacy Policy, or any problems or complaints may be directed to the Personal Information Officer by calling the customer enquiry number [Number].<br>\n<br>', '0000-00-00 00:00:00'),
(7, 'Homepage main', '<div class="col-xs-12 col-md-6 col-sm-6 sidebar">\n            <div class="page-header"><h3>Hire Qualified Professionals</h3></div>\n            <article>\n                <h3>Welcome to PT on Demand, Australias #1 trusted PT session requestor site.</h3>\n                <p>You can view all our listed trainers qualifications, specialties and experience with full reviews and ratings.</p>\n                <p>Get started by <a href="/register-member" title="register">registering</a> - all you need is a Paypal account or credit card- and then choose a day, time, location and type of session you want and wait for the trainers to respond to your request.</p>\n\n                <p>Once you start getting quotes through, you can then choose your preferred trainer by viewing their profile and quoted price of the session that you requested, if the trainer fits the right criteria, click accept and your session is booked! Get rewarded for each completed session with not only health and fitness benefits, but you can acquire store points in which you can make purchases through the PT on Demand reward site to help you reach your goals!</p>\n            </article>\n            <div class="fb-like" data-href="" data-layout="button_count" data-action="like" data-show-faces="true"></div>\n\n<p style="margin-top:12px;">\n<a href="javascript:void();" onclick="share(); return false;" class="btn btn-primary" style="background:#3F5AA7; font-size: 11px; border-radius: 4px;">\n<span><i class="fa fa-facebook-official fa-lg"></i></span> Share with your friends</a>\n</p>\n<p style="margin-top:12px;">\n<a href="https://twitter.com/ptondemandau" class="twitter-follow-button" data-show-count="false">Follow @ptondemandau</a>\n<a href="https://twitter.com/share" class="twitter-share-button" data-via="ptondemandau">Tweet</a>\n</p>\n\n        </div>\n</div>', '2015-11-05 04:49:23'),
(8, 'Home basic trainers', '<div class="page-header"><h3>Basic trainers</h3></div><img src="/uploads/media/45_2015/kickboxing-fitness-program.jpg" alt="kickboxing-fitness-program" class="featureImg"><p class="features">We have a range of trainers with various skills and qualifications. Our basic trainers have a minimum certificate III in gym instruction or group instruction. Most will either have their certificate IV in personal training or currently studying it.</p><a href="/register-trainer" class="btn">Find out more >></a>', '2015-11-05 04:47:39'),
(9, 'Home specialist trainers', '<div class="page-header"><h3>Specialist trainers</h3></div><img src="/uploads/media/45_2015/group-fitness-program-outdoors.jpg" alt="group-fitness-program-outdoors" class="featureImg"><p class="features">Specialist trainers have a chosen field in which they have a minimum 10 years experience in, or are university qualified in a particular health science field.</p><a href="/register-trainer" class="btn">Find out more >></a>', '2015-11-05 04:47:24'),
(10, 'Home Become a PTD trainer', '<div class="page-header"><h3>Become a PT on Demand trainer</h3></div>\n<img src="/uploads/media/45_2015/kickboxing-fitness-program.jpg" alt="kickboxing-fitness-program" class="featureImg">\n<p class="features">Want to be a trainer on PT on Demand? By <a href="/register-trainer" title="register">registering</a> you can expand your business by accessing job requests and the PT on Demand store.</p><a href="/register-trainer" class="btn">Find out more >></a>', '2015-11-05 04:47:15'),
(11, 'Trainers', '<div class="page-header">\n<h3>Trainers</h3>\n</div>', '2015-10-12 18:53:13'),
