(13, 'Home Register member', '<div class="col-xs-12 col-md-8 col-sm-8 left-content">    \n<div class="page-header">\n<h3>PT on Demand Members</h3>\n</div>\n<h3>Personal training that comes to you</h3>\n<p>Request a mobile personal training professional to come to you for outdoor or indoor training. You can do solo or group training with your friends or social group at your residence, favourite park or beach. </p>\n<p><img src="/uploads/media/45_2015/workout-on-beach-tire-flip.jpg" alt="workout-on-beach-tire-flip" width="100%"></p>\n<h3>PT Pricing</h3>\n<p>Training sessions charges vary depending on the type of training and location. You will receive quotes from trainers with the training sessions they offer.</p>\n</div>', '2015-11-05 04:49:43'),
(14, 'Home Register trainer', '<div class="col-xs-12 col-md-8 col-sm-8 left-content">\n<div class="page-header">\n<h3>PT on Demand Trainers</h3>\n</div>\n<h3>Be part of a growing PT network</h3>\n<p>Receive training requests from around your region for solo or group personal training. You can work one-on-one with clients the way that you like and be your own boss.</p>\n<p><img src="/uploads/media/45_2015/two-sportswomen-doing-crunches.jpg" alt="two-sportswomen-doing-crunches" width="100%"></p>        \n</div>', '2015-11-05 04:49:56'),
(15, 'FAQ', '<div class="page-header"><h3>FAQ</h3></div>\n\n<div class="col-sm-12 col-md-9 col-lg-9">\n<h4>Add PT On Demand app to your Phone & Tablet</h4>\n<p>PT On Demand is a web app that works best from your device home screen. Take a look at these screen shots to see how.</p>\n</div>\n\n<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">\n<h5>iPad Safari <strong>Add to Home Screen</strong></h5>\n<img src="/uploads/media/47_2015/ipad-add-to-home-screen.jpg" alt="ipad-add-to-home-screen" width="100%">\n\n<h5>iPad app icon</h5>\n<img src="https://ptondemand.com.au/uploads/media/47_2015/ipad-app-icon.jpg" alt="ipad-app-icon" width="100%">\n\n<h5>Android Chrome <strong>Add to Home Screen</strong></h5>\n<img src="https://ptondemand.com.au/uploads/media/47_2015/android-add-to-home-screen.jpg" alt="android-add-to-home-screen" width="100%">\n\n<h5>Android app icon</h5>\n<img src="https://ptondemand.com.au/uploads/media/47_2015/android-app-icon.jpg" alt="android-app-icon" width="100%">\n</div>\n\n<hr>\n\n<div class="col-sm-12 col-md-9 col-lg-9">\n<h4>Not receiving emails?</h4>\n<p>If your expecting email from us and its not been delivered please check your spam/junk folder as email sent from websites sometimes get spammed.</p>\n</div>', '2015-11-17 04:29:49');
